import React from "react";
import './style.scss';
import {BiCopyright, FaSearch} from "react-icons/all";
import Services from "../Services/Services";

class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {
        return (
            <div className="home-container">
                <section id="home">
                    <div className="container">
                        <div className="row">
                            <div className="col-md-12 col-sm-12">
                                <h3>Welcome to</h3>
                                <h1>Nair & Associates</h1>
                                <h6>ATTORNEY's AT LAW</h6>
                                <hr/>
                            </div>
                        </div>
                        <div className="searchBox">
                            <input className="searchInput" type="text" name="" placeholder="Search"/>
                            <button className="searchButton" href="#">
                                <FaSearch/>
                            </button>
                        </div>
                    </div>
                </section>
                <Services/>
                <footer>
                    <div className="copyright">
                        <p> <BiCopyright/> 2021 - Nair & Associates - {this.state.show.toString()}</p>
                    </div>
                    <div className="social">
                        <a className="support" onClick={evt => this.handleShow(evt)}>Disclaimer</a>
                        <a href="#" className="face">f</a>
                        <a href="#" className="tweet">t</a>
                        <a href="#" className="linked">in</a>
                    </div>
                </footer>
            </div>

        )
    }
}

export default Home;
